import 'dart:convert';
import 'dart:io';
import 'package:flutter/services.dart';
import 'package:path_provider/path_provider.dart';
import 'package:pdf/widgets.dart' as pw;
import 'package:pdf/pdf.dart';
import 'dart:typed_data';

class FileExporter {


  /// Muss einmal beim App-Start aufgerufen werden
  static final Uint8List logoBytes = base64Decode("""""");



  /// PDF-Erstellung, fr Hintergrund-Task optimiert
  static Future<String?> exportPdfInBackground({
    required List<Map<String, dynamic>> data,
    required String projectVar,
    required String userName,
    required String serialPump,
    required String serialHose,
    required String serialTool,
    required String tool,
    required String toleranz,
  }) async {
    if (data.isEmpty) return null;

    final now = DateTime.now();
    final dateString =
        "${now.year}-${now.month.toString().padLeft(2, '0')}-${now.day.toString().padLeft(2, '0')}";
    final safeProjectVar = projectVar.replaceAll(RegExp(r'[^a-zA-Z0-9_-]'), "_");
    final fileName = "${safeProjectVar}_$dateString.pdf";

    Directory dir;
    if (Platform.isAndroid) {
      dir = Directory('/storage/emulated/0/Download');
    } else {
      dir = await getApplicationDocumentsDirectory();
    }

    if (!await dir.exists()) await dir.create(recursive: true);
    final file = File('${dir.path}/$fileName');
    if (await file.exists()) await file.delete();

    final pdf = pw.Document();

    final headers = ["Nr.", "Solldruck [bar]", "Istdruck [bar]", "Solldrehmoment[Nm]", "Istdrehmoment[Nm]", "IO"];
    final tableRows = data.map((row) {
      return [
        "${row['Nr.'] ?? ''}",
        "${row['Solldruck'] ?? ''}",
        "${row['Nenndruck'] ?? ''}",
        "${row['Solldrehmoment'] ?? ''}",
        "${row['Nenndrehmoment'] ?? ''}",
        row['IO'] ?? "",
      ];
    }).toList();
    final ttfData = await rootBundle.load('assets/fonts/barlowregular.ttf');
    final myFontregular = pw.Font.ttf(ttfData);
    final ttfDatasemi = await rootBundle.load('assets/fonts/barlowsemibold.ttf');
    final myFontsemi = pw.Font.ttf(ttfDatasemi);
    final ttfDatabold = await rootBundle.load('assets/fonts/barlowbold.ttf');
    final myFontbold = pw.Font.ttf(ttfDatabold);


    pdf.addPage(
      pw.MultiPage(
        pageFormat: PdfPageFormat.a4,
        margin: const pw.EdgeInsets.fromLTRB(80,20,20,20),
        build: (context) => [
          // Logo
          pw.Container(
            height: 80, // maximale Hhe des Logos
            child: pw.Image(
              pw.MemoryImage(logoBytes),
              fit: pw.BoxFit.contain, // ganze Breite oder Hhe wird angepasst, nichts wird abgeschnitten
            ),
          ),
          pw.SizedBox(height: 12),

          // Projektdaten
          pw.Table.fromTextArray(
            headers: [],

            data: [
              if (userName.isNotEmpty) ['Name', userName],
              if (projectVar.isNotEmpty) ['Projektnummer', projectVar],
              if (serialPump.isNotEmpty) ['Seriennumer Pumpe', serialPump],
              if (serialHose.isNotEmpty) ['Seriennumer Schlauch', serialHose],
              if (serialTool.isNotEmpty) ['Seriennumer Werkzeug', serialTool],
              if (tool.isNotEmpty) ['Werkzeug', tool],
              if (toleranz.isNotEmpty) ['Toleranz', '$toleranz %'],
              ['Datum',dateString]
            ],

            border:null,
            cellPadding: const pw.EdgeInsets.only(bottom: 4),
            columnWidths: {0: const pw.FixedColumnWidth(170), 1: const pw.FlexColumnWidth()},
            cellStyle: pw.TextStyle(
              font: myFontbold,
              fontSize: 14,
            ),
          ),

          pw.SizedBox(height: 12),

          // Messwerte-Tabelle
          pw.Text("Messwerte", style: pw.TextStyle(fontSize: 18, fontWeight: pw.FontWeight.bold)),
          pw.SizedBox(height: 12),
          pw.Table(
            border: pw.TableBorder.all(color: PdfColors.grey400, width: 0.5),
            columnWidths: {
              0: const pw.FixedColumnWidth(20),
              1: const pw.FixedColumnWidth(65),
              2: const pw.FixedColumnWidth(65),
              3: const pw.FixedColumnWidth(85),
              4: const pw.FixedColumnWidth(85),
              5: const pw.FixedColumnWidth(20),
            },
            children: [
              // Kopfzeile
              pw.TableRow(
                decoration: const pw.BoxDecoration(color: PdfColors.grey600),
                children: headers
                    .map(
                      (h) => pw.Padding(
                    padding: const pw.EdgeInsets.all(5),
                    child: pw.Text(
                      h,
                      textAlign: pw.TextAlign.center,
                      style: pw.TextStyle(
                        color: PdfColors.white,
                        font: myFontsemi,
                        fontSize: 11,
                        fontWeight: pw.FontWeight.bold,
                      ),
                    ),
                  ),
                )
                    .toList(),
              ),
              // Datenzeilen
              ...tableRows.map((row) {
                final isOk = row[5].toString().toUpperCase() == "IO";
                return pw.TableRow(
                  children: row.map((cellText) {
                    if (cellText == row[5]) {
                      return pw.Container(
                        alignment: pw.Alignment.center,
                        padding: const pw.EdgeInsets.all(5),
                        color: isOk ? PdfColors.green300 : PdfColors.red300,
                        child: pw.Text(
                          cellText,
                          style: pw.TextStyle(
                              color: PdfColors.white,
                              font: myFontregular,
                              fontSize: 11,
                              fontWeight: pw.FontWeight.normal),
                        ),
                      );
                    }
                    return pw.Padding(
                      padding: const pw.EdgeInsets.all(5),
                      child: pw.Text(

                        cellText,
                        textAlign: pw.TextAlign.center,
                        style:pw.TextStyle(
                            color: PdfColors.black,
                            font: myFontregular,
                            fontSize: 11,
                            fontWeight: pw.FontWeight.normal
                        ),

                      ),
                    );
                  }).toList(),
                );
              }),
            ],
          ),
        ],
      ),
    );

    await file.writeAsBytes(await pdf.save());
    return file.path;
  }
}
